    let count = 0;
    for (let i = 1; i < n; i++) {
        for (let j = i + 1; j < n; j++) {
            let sum = (i * i - i + 1 + j * j - j + 1) % 3;
            if (sum === 0) {
                count += Math.floor((n - j - 1) / 2);
            } else if (sum === 1) {
                count += Math.floor((n - j - 1) / 3);
            }
        }
